import React from 'react';
import '../../assets/css/Button.css';
import { Link } from 'react-router-dom';

const Button = (props) => {
  return (
    <Link to={props.to} className='btn-mobile'>
      <button
        className={'btn btn--outline btn--large'}
      >
        {props.label}
      </button>
    </Link>
  );
}

export default Button;
